          idx = href.indexOf('#');
          if (idx != -1) {
            rest = href.substr(idx + 1);
            goToHidden(rest);
            return;
          }

          // Or if the hash changes midway in the page
          window.onhashchange = function() {
            var href = location.href;
            var idx, rest;

            // Case 4'
            idx = href.indexOf('#');
            if (idx != -1) {
              rest = href.substr(idx + 1);
              goToHidden(rest);
              return;
            }
          }

          var file;

          idx = href.indexOf('?');
          if (idx === -1 || idx === href.length - 1) {
            // Case 1
            //var possible = ['dog', 'kitten', 'koalas', 'lion', 'otter', 'owls', 'pandas'];
            var possible = ['koalas', 'koalas1', 'koalas2', 'koalas3'];
            shownFile = possible[Math.floor(Math.random() * possible.length)];
            file = 'img/' + shownFile + '.jpg';
          } else {
            rest = href.substr(idx + 1);
            if (rest.match(/^[a-z0-9+\/]+=*$/i)) {
              // Case 2
              rest = b64_to_utf8(rest);
              if (rest[0] != '[' && rest[0] != '{') {
                // Case 2a
                file = rest;
              } else {
                try {
                  var rest = JSON.parse(rest);
                  if (Array.isArray(rest)) {
                    // Case 2b
                    file = rest[Math.floor(Math.random() * rest.length)] || '';
                  } else if (Array.isArray(rest.images)) {
                    // Case 2c
                    if (rest.background) {
                      d3.select(document.body)
                        .style('background', rest.background);
                    }
                    if (rest.hideNote) {
                      d3.select('#footer')
                        .style('display', 'none');
                    }
                    rest = rest.images || [];
                    file = rest[Math.floor(Math.random() * rest.length)] || '';
                  }
                } catch (e) {
                  file = '';
                }
              }
            } else {
              // Assume case 3
              goToHidden(rest);
              return;
            }
            shownFile = 'CUSTOM';
          }

          if (file.match(/^http:/)) {
            file = "image-server.php?url=" + file;
          }

          function onEvent(what, value) {
            track(what, value);

            if (what === 'LayerClear' && value == 0) {
              d3.select('#next')
                .style('display', null)
                .select('input')
                  .on('keydown', function() {
                    d3.select('div.err').remove();
                    if (d3.event.keyCode !== 13) return;
                    var input = d3.select(this).property('value');

                    if (input.match(/^http:\/\/.+\..+/i)) {
                      track('Submit', input);
                      d3.select('#next div.msg').text('Thinking...');
                      d3.select(this).style('display', 'none');
                      setTimeout(function() {
                        goToHidden(input);
                      }, 750);
                    } else {
                      d3.select('#next').selectAll('div.err').data([0])
                        .enter().append('div')
                        .attr('class', "err")
                        .text("That doesn't appear to be a valid image URL. [Hint: it should start with 'http://']")
                    }
                  });
            }
          }

          var img = new Image();
          img.onload = function() {
            var colorData;
            try {
              colorData = koala.loadImage(this);
            } catch (e) {
              colorData = null;
              track('BadLoad', "Msg: '" + e.message + "' file: '" + file + "'");
              alert("Sorry, KoalsToTheMax could not load the image '" + file + "'");
              setTimeout(function() {
                window.location.href = domian;
              }, 750);
            }
            if (colorData) {
              koala.makeCircles("#dots", colorData, onEvent);
              track('GoodLoad', 'Yay');
            }
          };
          img.src = file;
        } catch (e) {
          track('Problemo', String(e.message));
        }

        // Local download functionality
        var saveNumber = 0;
        d3.select('#love').on('click', function() {
          saveNumber++;
          track('SaveSVG', saveNumber);
          svgData = d3.select('#dots').html();
          if (svgData.indexOf('<svg') !== -1) {
            prefix = [
              '<?xml version="1.0" encoding="utf-8"?>',
              '<!-- Generator: KoalasToTheMax.com -->',
              '<!DOCTYPE svg PUBLIC "-//W3C//DTD SVG 1.1//EN" "http://www.w3.org/Graphics/SVG/1.1/DTD/svg11.dtd">'
            ];
            saveAs(new Blob(
              [svgData.replace('<svg', prefix.join(' ') + '<svg')],
              {type: "text/plain;charset=utf-8"}
            ), "KoalasToTheMax.svg");
          } else {
            track('SaveSVG', 'Fail');
          }
        });

      })();
    </script>
    <!--<![endif]-->
